import React, { useState } from 'react';
import '../Styles/CartItem.css';

const CartItem = ({ item, onUpdateQuantity, onRemoveItem }) => {
  const [quantity, setQuantity] = useState(item.quantity || 1);

  const handleQuantityChange = (newQuantity) => {
    if (newQuantity < 1 || newQuantity > 10) return;
    
    // Get available quantity, default to 10 if not available
    const availableQty = item.available_quantity || item.book_quantity || 10;
    
    if (newQuantity > availableQty) {
      alert(`Only ${availableQty} available in stock`);
      return;
    }
    
    setQuantity(newQuantity);
    onUpdateQuantity(item.id, newQuantity);
  };

  const handleIncrement = () => {
    handleQuantityChange(quantity + 1);
  };

  const handleDecrement = () => {
    if (quantity > 1) {
      handleQuantityChange(quantity - 1);
    }
  };

  const handleRemove = () => {
    if (window.confirm(`Remove "${item.title}" from cart?`)) {
      onRemoveItem(item.id);
    }
  };

  // Safely parse price to number
  const parsePrice = (price) => {
    if (!price) return 0;
    if (typeof price === 'number') return price;
    if (typeof price === 'string') {
      const parsed = parseFloat(price.replace(/[^0-9.-]+/g, ''));
      return isNaN(parsed) ? 0 : parsed;
    }
    return 0;
  };

  const unitPrice = parsePrice(item.price);
  const totalPrice = unitPrice * quantity;
  
  // Get available quantity
  const availableQty = item.available_quantity || item.book_quantity || 10;
  
  // Stock status
  let stockStatus = '';
  let stockColor = '#28a745';
  
  if (availableQty > 5) {
    stockStatus = `✓ In Stock (${availableQty})`;
    stockColor = '#28a745';
  } else if (availableQty > 0) {
    stockStatus = `⚠ Low Stock (${availableQty})`;
    stockColor = '#ffc107';
  } else {
    stockStatus = '✗ Out of Stock';
    stockColor = '#dc3545';
  }

  return (
    <div className="cart-item">
      <div className="item-image">
        <img 
          src={item.image_url || 'https://picsum.photos/120/160'} 
          alt={item.title} 
          onError={(e) => {
            e.target.src = 'https://picsum.photos/120/160';
          }}
        />
      </div>
      
      <div className="item-details">
        <h3 className="item-title">{item.title}</h3>
        <p className="item-author">by {item.author}</p>
        <p className="item-category">{item.genre || 'Fiction'}</p>
        
        <div className="item-rating">
          <span className="rating-stars">{"★".repeat(Math.floor(item.rating || 4))}</span>
          <span className="rating-value">{item.rating || 4.0}</span>
        </div>
        
        <div className="item-stock" style={{ color: stockColor, marginTop: '8px' }}>
          {stockStatus}
        </div>
      </div>
      
      <div className="item-quantity">
        <button 
          onClick={handleDecrement} 
          className="quantity-btn" 
          disabled={quantity <= 1}
        >
          −
        </button>
        
        <input
          type="number"
          min="1"
          max={Math.min(10, availableQty)}
          value={quantity}
          onChange={(e) => {
            const value = parseInt(e.target.value);
            if (!isNaN(value)) {
              handleQuantityChange(value);
            }
          }}
          className="quantity-input"
        />
        
        <button 
          onClick={handleIncrement} 
          className="quantity-btn"
          disabled={quantity >= 10 || quantity >= availableQty}
        >
          +
        </button>
      </div>
      
      <div className="item-price">
        <p className="price">${totalPrice.toFixed(2)}</p>
        <p className="unit-price">${unitPrice.toFixed(2)} each</p>
        <button onClick={handleRemove} className="remove-btn">
          Remove
        </button>
      </div>
    </div>
  );
};

export default CartItem;
